State.init({
  showDelete: false,
});

const onCancel = () =>
  State.update({
    showDelete: false,
  });

let link = "";

const arr = item.action_title.split(/\s+/);
console.log("item: ", item);

const [action_type, amount, symbol, on, dexName1, dexName2] = arr;

const isBridge = arr[0].toLowerCase() === "bridge";

const isSwap = arr[0].toLowerCase() === "swap";

const isSupply = arr[0].toLowerCase() === "supply";
const isBorrow = arr[0].toLowerCase() === "borrow";
const isRepay = arr[0].toLowerCase() === "repay";

if (isBridge) {
  link = "/guessme.near/widget/ZKEVMSwap.zkevm-bridge?source=quest-card";
}
if (isSwap) {
  link = "/guessme.near/widget/ZKEVMSwap.zkevm-swap?source=quest-card";
}

if (isSupply) {
  link = "/guessme.near/widget/ZKEVM.AAVE";
}

if (isBorrow || isRepay) {
  link = "/guessme.near/widget/ZKEVM.AAVE?tab=borrow";
}

const onSaveParams = () => {
  if (isBridge) {
    const [action_type, symbol, from, chain] = arr;

    Storage.set("zk-evm-bridge-params", {
      symbol,
      chain,
    });
  }

  if (isSwap) {
    const [action_type, amount, symbol, on, dexName1, dexName2] = arr;

    const token = SwapTokens.find((item) => item.symbol === symbol);

    Storage.set("zk-evm-swap-params", {
      amount,
      symbol,
      dexName: dexName1 + (dexName2 ? " " + dexName2 : ""),
      assetId: token.address,
    });
  }
};

return (
  <QuestCardWrapper>
    <div
      className={"quest-card-out"}
      style={{
        border: !state.showDelete ? "2px solid transparent" : "",
      }}
      onClick={() => onSaveParams()}
    >
      <a className="quest-card-inner" href={link}>
        <div className="quest-card-info">{item.action_title}</div>
        <div className="quest-card-name">
          {iconMap[item.template]} {item.template}
        </div>
      </a>
    </div>

    <div className="quest-card-execute-date">
      <span className="quest-card-execute-date-number">
        My Execution
        <span>{item.count_number}</span>
      </span>

      <div
        className="quest-card-show-delete-icon"
        onClick={() => {
          State.update({
            showDelete: !state.showDelete,
          });
        }}
      >
        {state.showDelete ? deleteIcon : unDeleteIcon}
      </div>
    </div>

    {state.showDelete && (
      <div className="delete-card">
        <span>Delete This Quest?</span>

        <div className="delete-card-operation">
          <div
            className="delete-card-cancel-button"
            onClick={() => {
              onCancel();
            }}
          >
            Cancel
          </div>

          <div
            className="delete-card-delete-button"
            onClick={() => {
              console.log("item: ", item);

              onDelete(item.action_id);
              onCancel();
            }}
          >
            Delete
          </div>
        </div>
      </div>
    )}
  </QuestCardWrapper>
);
